module Test where

import qualified Data.ByteString.Base64 as B
import qualified Data.ByteString as BD
import qualified Data.ByteString.UTF8 as UTF
main :: IO ()
main = do
  let e = drop 22 dat
      d = UTF.fromString e
  either putStrLn id $ (B.decode d) >>= (Right . BD.writeFile "static/image-data.png")
  
dat :: String
dat = "data:image/png;base64,"
